import React, { useState } from "react";
import Navbar from "../components/Navbar";
import Footer from "../components/Footer/Footer";
import '../styles/Login.css';
import kakaoicon from "../images/icon/kakao-icon.png";
import facebookicon from "../images/icon/facebook.png";
import yega from '../images/aaa.png';
import { useNavigate } from "react-router-dom";
import api from '../../api'; // 설정한 axios 인스턴스 가져오기

const Login = () => {
  const [username, setUsername] = useState(''); 
  const [password, setPassword] = useState('');
  const navigate = useNavigate();

  // 로그인 요청 함수
  const handleLogin = async (e) => {
    e.preventDefault(); 

    try {
      const response = await api.post('/login', { username, password }, {
        withCredentials: true // 리프레시 토큰을 httpOnly 쿠키로 저장할 때 필요
      });

      // 엑세스 토큰을 응답 헤더에서 가져와 세션에 저장
      const accessToken = response.headers['access']; // 헤더 이름은 서버 설정에 따라 확인 필요
      if (accessToken) {
        sessionStorage.setItem('accessToken', accessToken); 
        sessionStorage.setItem('username', username); 
        alert('로그인 성공! 메인 페이지로 이동합니다.');
        
        navigate('/'); // 메인 페이지로 이동
      } else {
        alert('로그인 성공했으나 토큰이 반환되지 않았습니다.');
      }
    } catch (error) {
      console.error('로그인 요청 중 오류 발생:', error);
      let errorMessage = '아이디 또는 비밀번호가 올바르지 않습니다.';
      if (error.response && error.response.data && error.response.data.message) {
        errorMessage = error.response.data.message;
      }
      alert(`로그인 실패: ${errorMessage}`);
    }
  };

  // 회원가입 페이지로 이동하는 함수
  const loginJoin = () => {
    navigate('/Join');
  };

  return (  
    <div className="Login">
      <Navbar />
      <div className="background-image">
        <div className="content">
          <img src={yega} alt="logo" className="Login-logo" />
        </div>

        <div className="login-form">
          <form onSubmit={handleLogin}>
            <div className="input-group">
              <input
                type="text" 
                placeholder="이메일"
                className="username"
                value={username}
                onChange={(e) => setUsername(e.target.value)}
                autoComplete="username" 
                required
              />
            </div>
            <div className="input-group">
              <input
                type="password"
                placeholder="패스워드"
                value={password}
                onChange={(e) => setPassword(e.target.value)}
                autoComplete="password"
                required
              />
            </div>
            <div className="login-box">
              <p className="login-id" onClick={() => alert('아이디 찾기 기능')}>아이디 찾기 /</p>
              <p className="login-pass" onClick={() => alert('비밀번호 찾기 기능')}>비밀번호 찾기 /</p>
              <p className="login-join" onClick={loginJoin}>회원가입 </p>
            </div>
            <button type="submit" className="Loginbutton">로그인</button>
          </form>

          <div className="social-login">
            <div className="social-icons">
              <div className="facebook-box">
                <img src={facebookicon} alt="Facebook" className="facebook" />
                <div className="facebook-text">
                  <p>페이스북 로그인</p>
                </div>
              </div>

              <div className="kakao-box">
                <img src={kakaoicon} alt="Kakao" className="kakao" />
                <div className="kakao-text">
                  <p>카카오 로그인</p>
                </div>
              </div>
            </div>
          </div>
        </div>
      </div>
      <Footer />
    </div>
  );
};

export default Login;
